import React from "react";
import Navbar from "./Navbar";
import Main from "./Main";
import Footer from "./Footer";
import "./MainPage.css";

const MainPage = () => {
  return (
    <div className="main-page">
      {/* Navbar Component */}
      <Navbar />

      {/* Main Content Section */}
      <Main />

      {/* Footer Component */}
      <Footer />
    </div>
  );
};

export default MainPage;
